import React ,{useEffect}from 'react';

import { Jumbotron } from 'reactstrap';

const About=()=>{

    useEffect( () => {
        document.title="About";
    },[]);
    

    return (
        <div>
            <Jumbotron>
                <p>This is my First ReactJs webApplication</p>

            </Jumbotron>
        </div>
    )
};

export default About;
